import React from 'react';
import logo from '../images/logo.svg';

const Footer = () => {
    return (
        <>
            <div className="font-popins text-center">
                <div className="flex flex-col ">
                    <div className=" flex flex-col justify-center items-center mt-8 px-8">
                        <img src={logo} alt="logooo"/>
                       <span className="text-gray-cf leading-[2rem] mt-4">Fast delivery, which is active all over the world, serves with many transportation vehicles.</span>
                    </div>
                    <div className="my-2" >
                        <span className="font-normal text-2xl py-4">Company</span>
                        <div className="text-gray-cf flex flex-col">
                            <a className="text-gray-cf hover:text-black">About Us</a>
                            <a>Blog</a>
                            <a>All Products</a>
                            <a>Locations Map</a>
                        </div>
                    </div>
                    <div></div>
                    <div></div>
                </div>
                <div></div>
                <div></div>
            </div>
        </>
    );
};

export default Footer;
